import React from 'react'
import {
    IconButton,
    SpeedDial,
    SpeedDialHandler,
    SpeedDialContent,
    SpeedDialAction,
  } from "@material-tailwind/react";
  import {
    PlusIcon,
    HomeIcon,
    CogIcon,
    Square3Stack3DIcon,
  } from "@heroicons/react/24/outline";

function Home() {
    const home = {
        textAlign: 'center',
        marginTop: '100px'
    }
  return (
    <div>
        <h2 style={home}>Home</h2>
    </div>
  )
}

export default Home
